import React, { Component } from 'react';



class HeaderSub extends Component {

	render(){
		return(
			<div style={{backgroundColor:'rgb(20,20,20)', height:'60px', paddingLeft:'16px', paddingRight:'16px', display:'flex', alignItems:'center', justifyContent:'space-between'}}>
				<div>
					<span className='white'>SHOPMATE</span>
				</div>

				<div className='white'>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Women</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Men</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Kids</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Shoes</span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}>Brands</span>
				</div>

				<div>
					<input style={{backgroundColor:'gray'}} placeholder='Search' className='form-control'/>
				</div>

				<div>
					<span className='white'>User</span>
				</div>
			</div>

		);
	}
}





export default HeaderSub;
